function App() {
  const [ipData, setIpData] = useState([]);

  useEffect(() => {
    fetchData();
  }, [ipData]);

  const fetchData = async () => {
    const response = await FraudIp();
    console.log("response ", response);
    setIpData([response]);
  };

  return (
    <div>
      {ipData.map((data) => {
        return <h1>{data.ASN}</h1>;
      })}
    </div>
  );
}

export default App;
